import React from "react";
import Login from "../users/new";

import 
{ BrowserRouter as Router, Routes, Route} 
    from "react-router-dom";

function Header() {
return (
    <header>
        <h1>Keeper</h1>
        <Router>
            <Routes>
                {Login}<Route exact path='/new' element={<Login/>} />
            </Routes>
        </Router>

    </header>

)};



export default Header;
